import style from './MainBox3.module.css'

import cup from '../images/cup'
import { useState } from 'react';


function MainBox3() {
    const [load, setLoad] = useState(true)

    setTimeout(() => {
   setLoad(false)
    }, 4000);

    return(

        <div className={style.box}>
           {load ? <p className={style.loading} id={style.loadingImg}  /> : <img src={cup} alt='cup'/>}
            {load ? <p className={style.loading} /> : <p>These are some texts</p>}
            {load ? <p className={style.loading} /> : <p>Amazon cup,</p>}
            {load ? <p className={style.loading} /> : <p>The best product provided.</p>}


        </div>
    )
}
export default MainBox3
